let c = document.getElementById('animation');
let ctx = c.getContext('2d');
let count=100;
let ftext="Save The Data";
let ltext="Hello World";
const startBtn = document.querySelector("#start");
const playBtn = document.querySelector("#play");
const updateBtn = document.querySelector("#update");
const img = new Image();
img.src = 'data:image/png;base64,';

downloadButton.disabled = true;


function changeFirstLine(){
	return ftext=document.getElementById("first_line").value;
}

function changeLastLine(){
	return ltext = document.getElementById("last_line").value;
}


function draw() {
	count++;
	ftext = document.getElementById("first_line").value; 
	ltext = document.getElementById("last_line").value; 
	ctx.clearRect(0,0,600,600);
	ctx.fillStyle = "#fff";
	ctx.fillRect(0,0, 600, 600);
	ctx.drawImage(img, 10,10, 580, 580)
	ctx.textAlign = "center";
	ctx.fillStyle = "#000";
	ctx.font = "30px Arial";
	ctx.fillText(ltext, count, 300);
	ctx.font = "14px Arial";
	ctx.fillText(ftext, 600-count, 270);

	if (count<299) {
		setTimeout(draw, 10);
	}else{
		count=100;
		stopRecording();
	    downloadButton.disabled = false;
	}
}

startBtn.onclick = Record;
playBtn.onclick = playOnly;
updateBtn.onclick = playOnly;
window.onload = playOnly;

function Record() {
	startRecording();
	draw();
}

function playOnly() {
	draw();
}

document.getElementById("first_line").addEventListener("keyup", changeFirstLine);
document.getElementById("last_line").addEventListener("keyup", changeLastLine);

// audio play
var audioElement = new Audio;
audioElement.src = 'http://192.168.1.34:8000/static/media/test_aud.mp3';

audioElement.addEventListener('ended', function() {
    this.play();
}, false);

audioElement.addEventListener("canplay",function(){
    $("#length").text("Duration:" + audioElement.duration + " seconds");
    $("#source").text("Source:" + audioElement.src);
    $("#status").text("Status: Ready to play").css("color","green");
});

audioElement.addEventListener("timeupdate",function(){
    $("#currentTime").text("Current second:" + audioElement.currentTime);
});

$('#playbutton').click(function() {
    audioElement.play();
    $("#status").text("Status: Playing");
});

$('#pausebutton').click(function() {
    audioElement.pause();
    $("#status").text("Status: Paused");
});

$('#restartbutton').click(function() {
    audioElement.currentTime = 0;
});
